import React, {useEffect, Suspense, Lazy} from 'react';
import { useDispatch } from 'react-redux';
import { ShowHeader } from '../../actions/actions';
import Slider from '../slider/slider';
import Bar from '../bar/bar';
import globalstyle from '../../style.module.css';
import ViewedProductsContainer from '../../containers/viewedProductsContainer/viewedProductsContainer';

const ProductCategoryContainer = React.lazy(() => import('../../containers/productCategory/productCategoryContainer'));

function Home() {
    const dispatch = useDispatch();
    useEffect(() => {
        dispatch(ShowHeader(true));
    }, []);    
return (
<>
<Slider/>
<Bar/>
<Suspense fallback={
  <div className={globalstyle.loadingContainer}>
<div className={globalstyle.loading}>
<div className={globalstyle.shape1}></div>
</div>
</div>
}>
<ProductCategoryContainer limit="10"/>
</Suspense>
{/* <ViewedProductsContainer /> */}
</>
);
}

export default Home;
